import instantsearch from 'instantsearch.js';
import algoliasearch from 'algoliasearch';
import {
  searchBox,
  clearRefinements,
  refinementList,
  currentRefinements,
  stats,
  hits,
  pagination,
  voiceSearch,
  configure,
  index,
} from 'instantsearch.js/es/widgets';
import {
  connectRefinementList,
  connectQueryRules,
  connectCurrentRefinements,
  connectAutocomplete,
  connectSearchBox,
  connectHierarchicalMenu,
  connectHits,
} from 'instantsearch.js/es/connectors';
import { autocompleteSearchResult } from './autocomplete';

import {
  autocomplete,
  getAlgoliaResults,
  snippetHit,
} from '@algolia/autocomplete-js';
import { createQuerySuggestionsPlugin } from '@algolia/autocomplete-plugin-query-suggestions';
import { createLocalStorageRecentSearchesPlugin } from '@algolia/autocomplete-plugin-recent-searches';
// import algoliasearch from "algoliasearch";
// import searchResults from "./searchResults";
import '@algolia/autocomplete-theme-classic';
import { GetDataForCarousel } from '../getCarousel';
import { carousel } from '../displayCarousel';

export function searchResults() {
  const searchClient = algoliasearch(
    'HYDY1KWTWB',
    '28cf6d38411215e2eef188e635216508'
  );

  const search = instantsearch({
    indexName: 'gstar_demo_test',
    searchClient,
  });

  const renderRefinementList = (renderOptions, isFirstRender) => {
    const {
      items,
      isFromSearch,
      refine,
      createURL,
      isShowingMore,
      canToggleShowMore,
      searchForItems,
      toggleShowMore,
      widgetParams,
    } = renderOptions;

    if (isFirstRender) {
      // const input = document.createElement('input');
      const ul = document.createElement('ul');
      widgetParams.container.appendChild(ul);
    }

    widgetParams.container.querySelector('ul').innerHTML = items
      .map(
        item => `
                  <li style="${isRefined(item)}">
                    <a
                      href="${createURL(item.value)}"
                      data-value="${item.value}"
                      style="${isRefined(item)}"
                    >
                      ${item.label} <span style="${isRefined(item)}">(${
          item.count
        })</span>
                    </a>
                  </li>
                `
      )
      .join('');

    [...widgetParams.container.querySelectorAll('a')].forEach(element => {
      element.addEventListener('click', event => {
        event.preventDefault();
        refine(event.currentTarget.dataset.value);
      });
    });

    // const button = widgetParams.container.querySelector('button');

    // // button.disabled = !canToggleShowMore;
    // button.textContent = isShowingMore ? 'Show less' : 'Show more';
  };

  function isRefined(item) {
    if (item.isRefined) {
      return 'color: white !important; background-color: rgba(0,0,0, 0.9)';
    }
  }

  // Create the render function
  const renderQueryRuleCustomData = (renderOptions, isFirstRender) => {
    const { items, widgetParams, refine } = renderOptions;

    if (isFirstRender) {
      // const inputSearchResult = document.querySelector('.ais-SearchBox-input');
      // inputSearchResult.addEventListener('change', (e) => {
      //     if (e) {
      //         refine({
      //             ruleContexts: ['men_banner'],
      //         });
      //     } else {
      //         refine({});
      //     }
      // });
    }

    widgetParams.container.innerHTML = `
            <div class="banner-wrapper">
              ${items
                .map(
                  item =>
                    `<a href="${item.link}">
                            <div class="banner-overlay"></div>
                            <div class="banner-title--wrapper">
                                <h3>${item.title}</h3>
                                <div class="underline-bannerTitle"></div>
                            </div>
                            <img src="${item.banner}">
                        </a>`
                )
                .join('')}
            </div>
          `;
  };

  // CURRENT REFINMENT

  const createDataAttribtues = refinement =>
    Object.keys(refinement)
      .map(key => `data-${key}="${refinement[key]}"`)
      .join(' ');

  const renderListItem = item => `
      ${item.refinements
        .map(
