              ]);
            }

            indexWidget.addWidgets([
              carousel({
                title: carouselConfig.title,
                container: carouselContainer,
              }),
            ]);

            container.appendChild(carouselContainer);
            return indexWidget;
          });
        }

        // retrieve the carousel configuration once
        getCarouselConfigs().then(carousels => {
